import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>We are a team of passionate individuals dedicated to creating awesome web applications.</p>
      <p>Our mission is to build innovative solutions that make people's lives easier.</p>
      <p>Feel free to reach out to us if you have any questions or collaboration ideas!</p>
    </div>
  );
}

export default About;
